content:
mua dịp super brand day 20/4, đây là lần mua hàng thất vọng nhất tại lazada từ dịch vụ giao hàng đến chất lượng sản phẩm:
- kho hàng không xuất hàng đi nhưng app vẫn báo đang vận chuyển. tôi đợi từ trưa đến tối thì app báo tiếp giao không thành công do gọi tôi không được, trong khi tôi xem tracking ahamove thì báo không ai đi giao hàng. lazada làm ăn láo còn đổ lỗi cho khách;
- gọi hotline và chat với lazada: nhân viên trả lời quanh co rồi cúp ngang không hỗ trợ, không lời xin lỗi;
- 21/4 nhận hàng: chạy thử máy kêu ầm ầm, lại phải nhắn tin và gọi trung tâm bảo hành. họ báo phải mang ra trung tâm sửa máy.

đúng là mua sự bực bội.
